import{_ as r,a,b as o,c as t}from"./chunks/rtk_holybro_h-rtk-f9p_spec.B9usuLHv.js";import{_ as e}from"./chunks/rtk_holybro_h-rtk_mount_3.CoODdqav.js";import{_ as s,c as l,o as p,ab as h}from"./chunks/framework.CUflZczI.js";const T=JSON.parse('{"title":"Holybro H-RTK-F9P GNSS","description":"","frontmatter":{},"headers":[],"relativePath":"uk/gps_compass/rtk_gps_holybro_h-rtk-f9p.md","filePath":"uk/gps_compass/rtk_gps_holybro_h-rtk-f9p.md"}'),i={name:"uk/gps_compass/rtk_gps_holybro_h-rtk-f9p.md"},_=h('<h1 id="holybro-h-rtk-f9p-gnss" tabindex="-1">Holybro H-RTK-F9P GNSS <a class="header-anchor" href="#holybro-h-rtk-f9p-gnss" aria-label="Permalink to &quot;Holybro H-RTK-F9P GNSS&quot;">​</a></h1><p>Модель <a href="https://holybro.com/products/h-rtk-f9p-gnss-series" target="_blank" rel="noreferrer">Holybro H-RTK F9P GNSS</a> є багатосмуговою високоточною серією систем <a href="./../gps_compass/rtk_gps.html">RTK GNSS</a>, запущеною Holybro. Ця сім&#39;я подібна до серії <a href="./../gps_compass/rtk_gps_holybro_h-rtk-m8p.html">H-RTK M8P</a>, але використовує багатосмуговий RTK зі швидшими часами зближення і надійною продуктивністю, одночасний прийом GPS, GLONASS, Galileo і BeiDou та швидше оновлення для високодинамічних та великов&#39;язаних застосувань з точністю на рівні сантиметрів. Він використовує модуль u-blox F9P, компас IST8310 та індикатор з триколірним світлодіодом. Також в ньому є інтегрований вимикач безпеки для простої та зручної роботи.</p><p>Є три моделі Holybro H-RTK F9P на вибір, кожна з різним дизайном антени, щоб задовольнити різні потреби. Дивіться розділ <a href="#specification-and-model-comparison">Характеристики та порівняння моделей</a> для отримання додаткової інформації.</p><p>Використовуючи RTK, PX4 може отримати своє положення з точністю до сантиметра, що набагато точніше, ніж може забезпечити звичайний GPS.</p><p><img src="'+r+'" alt="h-rtk"></p><h2 id="де-придбати" tabindex="-1">Де придбати <a class="header-anchor" href="#де-придбати" aria-label="Permalink to &quot;Де придбати&quot;">​</a></h2><ul><li><a href="https://holybro.com/products/h-rtk-f9p-gnss-series" target="_blank" rel="noreferrer">H-RTK F9P (сайт Holybro)</a></li><li><a href="https://holybro.com/collections/h-rtk-gps" target="_blank" rel="noreferrer">H-RTK Аксесуари (сайт Holybro)</a></li></ul><h2 id="налаштування" tabindex="-1">Налаштування <a class="header-anchor" href="#налаштування" aria-label="Permalink to &quot;Налаштування&quot;">​</a></h2><p>Налаштування та використання RTK на PX4 за допомогою <em>QGroundControl</em> відбувається за принципом &quot;підключи і працюй&quot; (див. <a href="./../gps_compass/rtk_gps.html">RTK GPS</a> для отримання додаткової інформації).</p><h2 id="проводка-та-з-єднання" tabindex="-1">Проводка та з&#39;єднання <a class="header-anchor" href="#проводка-та-з-єднання" aria-label="Permalink to &quot;Проводка та з&#39;єднання&quot;">​</a></h2><p>Моделі ГП-ШТК Вертолітного типу поставляються як з кабелями GH 10-pin, так і з 6-pin, які сумісні з портами GPS1 та GPS2 на контролерах польоту, що використовують Стандартний роз&#39;єм Pixhawk, такі як <a href="./../flight_controller/pixhawk4.html">Pixhawk 4</a> та <a href="./../flight_controller/pixhawk5x.html">Pixhawk 5x</a>.</p><p>H-RTK Rover Lite доступний у двох версіях. Стандартна версія поставляється з 10-контактним роз&#39;ємом для порту <code>GPS1</code>. Версія &quot;2nd GPS&quot; поставляється з роз&#39;ємом на 6 контактів для порту <code>GPS2</code>. Це використовується як додатковий GPS для <a href="./../gps_compass/#dual_gps">Подвійних GPS-систем</a>.</p><div class="info custom-block"><p class="custom-block-title">Кабелі/конектори можуть потребувати модифікації для підключення до інших плат керування польотом (див. <a href="#pin-map">карту штифтів</a> нижче).</p></div><h2 id="карта-виводів" tabindex="-1">Карта виводів <a class="header-anchor" href="#карта-виводів" aria-label="Permalink to &quot;Карта виводів&quot;">​</a></h2><p><img src="'+a+'" alt="h-rtk-f9p_rover_pinmap"></p><p><img src="'+o+'" alt="h-rtk-f9p_helical_pinmap"></p><h2 id="специфікація-та-порівняння-моделеи" tabindex="-1">Специфікація та порівняння моделей <a class="header-anchor" href="#специфікація-та-порівняння-моделеи" aria-label="Permalink to &quot;Специфікація та порівняння моделей&quot;">​</a></h2><p><img src="'+t+'" alt="h-rtk-f9p_spec"></p><h2 id="аксесуари-до-gps" tabindex="-1">Аксесуари до GPS <a class="header-anchor" href="#аксесуари-до-gps" aria-label="Permalink to &quot;Аксесуари до GPS&quot;">​</a></h2><p><a href="https://holybro.com/products/vertical-mount-for-h-rtk-helical" target="_blank" rel="noreferrer">H-RTK кріплення (сайт Holybro)</a></p><p><img src="'+e+'" alt="h-rtk"></p>',21),c=[_];function n(m,d,f,k,b,u){return p(),l("div",null,c)}const G=s(i,[["render",n]]);export{T as __pageData,G as default};
